import React from "react";
import { PDFDownloadLink, Document, Page } from "react-pdf";
import pdf from "../pdf/mypdf.pdf";

const styles = {
  container: {
    marginLeft: "30px",
    marginTop: "30px",
  },
  p: {
    display: "block",
    marginBottom: "10px",
    color: "black",
    fontSize: "20px",
  },
};

function MyDocument() {
  return (
    <Document>
      <Page>
        <p>This is my PDF document!</p>
      </Page>
    </Document>
  );
}

function Resume() {
  return (
    <PDFDownloadLink document={<MyDocument />} fileName={pdf}>
      {({ blob, url, loading, error }) =>
        loading ? "Loading document..." : "Download PDF"
      }
    </PDFDownloadLink>
  );
}

export default Resume;
